import React from 'react';

function Navbar() {
  return (
    <nav className="navbar">
      <h1><img src="logo.jpeg" alt="Logo" class="logo"/></h1>
      <ul class="item">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
